import React, { Component } from "react";
import NavBar from "./components/NavBar";
import TextField from "@material-ui/core/TextField";
import Async from "react-async";
import "./index.css";

class App extends Component {
  constructor() {
    super();
    this.state = {
      loading: false,
      tickers: []
    };
  }
  componentDidMount() {
    fetch("https://api.stocktwits.com/api/2/streams/symbol/TSLA.json")
      .then(response => response.json())
      .then(data => {
        this.setState({
          tickers: data
        });
      });
  }
  render() {
    return <div>{this.state.tickers.body}</div>;
  }
}
export default App;
